import './App.scss';
import Header from './NavBar/Header.jsx';
import Section from './NavBar/Section';
import Aside from './Aside/Aside';
import Aside_Profile from './Aside_Profile/Aside_Profile';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import AsideNews from './Aside_News/Aside_News';
import Aside_Music from './Aside_Music/Aside_Music';
import FriendsContainer from './Aside_Friends/FriendsContainer';



const App=(props)=> {
  return (
    <BrowserRouter>
    <div className="App">
    <Header></Header>
    <Section></Section>
    <Switch>
    <Route path='/aside' render={()=><Aside ></Aside>}></Route>
    <Route path='/profile' component={Aside_Profile}></Route>
    <Route path="/music" component={Aside_Music}></Route>
    <Route path="/friends" render={()=><FriendsContainer></FriendsContainer>}></Route>
    <Route path="/" render={()=><AsideNews ></AsideNews>}></Route>
    </Switch>
 </div>
 </BrowserRouter>
  );
}

export default App;
